import React from 'react';

const Carrinho = () => {
  return (
    <div>
        <main class="principal margin_fixed">
    <section class="carrinho">
      <button class="adicionar__carrinho comprar" id="finalizarCompra">Finalizar Compra</button>
    </section>
  </main>
    </div>
  );
};

export default Carrinho;
